import React from "react"
import "./navbar.css";
import { Link } from "react-router-dom";
import logo from "./img/logo.png";
function Navbar() {
    return(
        <div>
            
        <nav className="main-nav">
            <div className="logo">
                <img className="pics" src={logo} alt="logo"/>
            </div>
            <div className="menu">
                <ul>
                    
                    <li>
                        <Link to="/">HOME</Link>
                    </li>
                </ul>

            </div>
           

        </nav>
        
    </div>
    )
}
export default Navbar;
